import React from 'react';
import ReactDOM from 'react-dom';
// import 'antd/dist/antd.css';
import { Layout, Menu, Icon, Breadcrumb } from 'antd';
import App from './App';
import IconFont from './iconfont/font';
import Sidebar from './components/Sidebar/Sidebar';
import Header from './components/Header/Header';

import './index.css';


if(module.hot)
{
    module.hot.accept();
}

const { Content } = Layout;
const SubMenu = Menu.SubMenu;

// const IconFont = Icon.createFromIconfontCN({
//   scriptUrl: '//at.alicdn.com/t/font_1050856_g3xhywuvbnb.js',   //阿里巴巴图标引用地址
// });
class MallProject extends React.Component {
  state = {
    collapsed: false,
  };
  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  }

  render() {
    return (
      <Layout style={{height:" 100%",border:" 1px solid rgb(230, 230, 230)"}}>
       <Sidebar 
          trigger={null}
          collapsible
          collapsed={this.state.collapsed}
          onCollapse={this.onCollapse}
       />
        <Layout  style={{ background: 'rgb(240, 242, 245)'}}>
          <SS trigger
          >
          </SS>
          <Content style={{padding: 20, background: '#fff', minHeight: 280,margin: "24px 0 0 16px"
        }}
          >
          <App/>
          </Content>
        </Layout>
      </Layout>
    );
  }
}

ReactDOM.render(<MallProject />, document.getElementById('container'));
